      body {
        margin: 0;

        font-weight: 400;
        background-color: #181818;
        color: #ededed;
      }

      #card {
        display: grid;
        grid-template-columns: repeat(2, auto);
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        background-color: #1d1d1d;
        font-family: "IBMPlexSans";
        font-weight: 400;
        padding: 1rem;
        border-radius: 0.25rem;
      }

      #maintenance {
        grid-column: 1;
      }
      #maintenance-img {
        width: 75%;
        min-width: 200px;
        height: auto;
      }
      @media (max-width: 600px) {
        #maintenance-img {
          display: none;
        }
      }

      #info {
        grid-column: 2;
      }

      a {
        text-decoration: none;
        color: #5865f2;
      }

      @font-face {
        font-family: "IBMPlexSans";
        font-style: normal;
        font-weight: 400;
        src: url("/fonts/IBMPlexSans.woff2") format("woff2"),
          url("/fonts/IBMPlexSans.woff") format("woff");
      }
    </style>
